	TSPEED = 3200; WCKCKRATIO = 2; BA0ADDR = "X16"; L_DELAY = "N";
	configure_CA_set(WCKCKRATIO / 2);

	//LP5VD2 = 0.99 V;
	//LP5TCK = 612.5 PS;
